"use client";
import { useState } from "react";
import Grid from "@mui/material/Grid"; // GLOBAL CUSTOM HOOK

import useCart from "hooks/useCart"; // LOCAL CUSTOM COMPONENTS

import CartItem from "../cart-item";
import EmptyCart from "../empty-cart";
import CheckoutForm from "../checkout-form";
export default function CartPageView() {
  const [zipCode, setZipCode] = useState("")
  const [shippingRates, setShippingRates] = useState("")
  const [rateClac, setRateCalc] = useState(false)

  const handleZipChange = (zipCode) => {
    setZipCode(zipCode)
  }
  const handleShippingRateChange = (rate) => {
    setShippingRates(rate)
    setRateCalc(true)
  }

  const defaultCart = {
    id: 1,
    name: "No Items in cart",
    price: 0,
    qty: 0,
    slug: "cart",
    imgUrl: ""
  }

  const {
    state
  } = useCart();
  return <Grid container spacing={3}>
    {
      state.cart.length > 0 ? <>      <Grid item md={8} xs={12}>
      {state.cart.map(({
      name,
      id,
      price,
      qty,
      slug,
      imgUrl
    }) => <CartItem id={id} key={id} qty={qty} name={name} slug={slug} price={price} imgUrl={imgUrl} />)}
    </Grid>

    <Grid item md={4} xs={12}>
      <CheckoutForm shippingRates={shippingRates} handleZipChange={handleZipChange} handleShippingRateChange={handleShippingRateChange} zipCode={zipCode} rateClac={rateClac} />
    </Grid></> : <>      <Grid item md={12} xs={12}>
 <EmptyCart id={defaultCart.id} key={defaultCart.id} qty={defaultCart.qty} name={defaultCart.name} slug={defaultCart.slug} price={defaultCart.price} imgUrl={defaultCart.imgUrl} />
    </Grid>
</>
    }

    </Grid>;
}